`,w.jsx(a.p,{children:"You might be wondering what a keystone landscape actually looks like in your yard, how much work it takes, or whether it will attract unwanted pests. Here are answers to some of the questions homeowners ask most often."}),`
`,w.jsx("br",{}),`
`,w.jsx(a.h4,{children:"Will it look weedy?"}),`
`,w.jsx(a.p,{children:"We understand why you may think this if you've seen aggressive plants like Canada Goldenrod and Common Milkweed taking over a site!  Thankfully, there are many well-behaved native species that work beautifully in residential landscapes.  A keystone landscape can offer the best of all worlds: tidy, eco-beneficial, and low maintenance.  Designed with clean edges, layered groupings, and natural color patterns, it feels intentional, polished, and full of life."}),`
`,w.jsx("br",{}),`
`,w.jsx(a.h4,{children:"Will it attract bugs?"}),`
`,w.jsx(a.p,{children:"Yes! And thats a great thing! Keystone landscapes support butterflies, native bees, and other pollinators that keep your garden healthy and vibrant. Most of these insects are small, non-aggressive, and essential to a balanced ecosystem."}),`
